import React from 'react'
import css from "../components/menu.css"
import json from "../data/menuItems.json"


class Menu extends React.Component{
    constructor(props){
        super(props)
    }

    render(){

        console.log(typeof(json.data))
        console.log(json.data[1].name)
        const newData = json.data
        const listItems = newData.map((d) => <li key={d.name}>{d.name}</li>)
        return(
            <div className={css.menuContainer}>
                {listItems}
            </div>
        )
    }

}


export default Menu

